import React, { Component } from 'react';
import { BrowserRouter as Router, Route } from "react-router-dom" ;
import "bootstrap/dist/css/bootstrap.min.css";

import './Home.css';
import Navibar from './Navibar';
import NavibarWithSearch from './NavibarWithSearch';
import CreateUser from "./Createuser";
import Sample from './sample artifact.jpeg';
import FilterPool from './FilterPool';
import Update from './Update';


class Home extends Component {
    render(){
        return(
          <Router>
          <body>
           <NavibarWithSearch />
           <Route path="/" exact component={ArtifactList} />
           <Route path="/user" component={CreateUser} />

            <div className="row">
              <div className="col-sm-4" id="card1">
                <div className="card">
                  <img className="card-img-top" src={Sample} alt="Artifact image" width="100px" height="100px"/>
                  <div className="card-body">
                    <h5 className="card-title">Artifact Name</h5>
                    <span class="badge badge-pill badge-info">filter1</span>
                    <p className="card-text">Artifact desciptions will appears here.</p>
                    <a href="###" class="btn btn-outline-info">Go somewhere</a>
                  </div>
                </div>
              </div>
              <div className="col-sm-4">
                <div className="card" id="card2">
                  <img className="card-img-top" src={Sample} alt="Artifact image" width="100px" height="100px"/>
                  <div className="card-body">
                    <h5 className="card-title">Artifact Name</h5>
                    <span class="badge badge-pill badge-warning">filter2</span>
                    <p className="card-text">Artifact desciptions will appears here.</p>
                    <a href="###" class="btn btn-outline-info">Go somewhere</a>
                  </div>
                </div>
              </div>
              <div className="col-sm-4">
                <FilterPool />
                <Update/>
              </div>
            </div>
          </body>
          </Router>
        );
    }
}

export default Home;
